Questo Festival lo abbiamo preparato per quasi un anno. Quasi come dovevamo essere noi i conduttori. Ma c’era un numero che pesava come un macigno: 70! Un Compleanno troppo importante per non essere celebrato a dovere. Sono convinto, infatti, che anche gli organizzatori abbiano fatto lo stesso pensiero. Facciamo fare anche le tre di notte ogni sera ma, deve essere una grande festa! Salutiamo un Festival straordinario, intenso, massacrante, senza pause e con tre ore di sonno a notte. Le nostre “macchine” non si sono fermate un attimo ma, Sanremo è una sorta di patrono d’Italia, va rispettato e venerato. Abbiamo cercato di fare il nostro meglio salendo sulla giostra di questa comunicazione che corre sempre più a mille all’ora. Una settimana fantastica vissuta con amici, colleghi e compagni di viaggio che porti per sempre nel cuore. Una settimana fantastica resa possibile solo dai supereroi dell’Ufficio Stampa Rai (Fabiola Sanesi, Michele Trobbiani, Luca Romanelli e Gianmarco Fabbrini) che ci permettono di lavorare e vivere esperienze che appartengono già alla storia. Un abbraccio grande come il mare di Sanremo a due compagni di viaggio unici: Vincenzo Lombardi, con il quale speriamo di toglierci tante soddisfazioni sotto il segno di GIORNALE NEWS e Vincenzo Nicolello, “mio fratello piemontese”. Grazie al mio amico Valerio Iovinella che mi ha sostenuto in questa avventura, grazie anche Ciro Guarino insieme a Valerio credono in me e nel mio lavoro.
SANREMO70 sei stato luce abbagliante, musica, sguardi, sorrisi, polemiche, amarezze e gioie…. in una sola parola sei stato…SANREMO, lo spettacolo che tutti ci invidiano. Noi per sicurezza iniziamo già a prepararci per il 2021… Ciao Ariston, “casa” della settimana più folle e spericolata dell’anno
